CREATE TABLE IF NOT EXISTS `attivita` (
  `ID_Att` int(10) UNSIGNED NOT NULL AUTO_INCREMENT,
  `Nome_Att` varchar(45) NOT NULL,
  `Descrizione_Att` varchar(5000) DEFAULT NULL,
  `Immagine_Att` longblob DEFAULT NULL,
  PRIMARY KEY (`ID_Att`)
) ENGINE=MyISAM AUTO_INCREMENT=9 DEFAULT CHARSET=latin1;

INSERT INTO `attivita` (`ID_Att`, `Nome_Att`, `Descrizione_Att`, `Immagine_Att`) VALUES
(1, 'IMMERSIONE CON I DELFINI', 'Nuotare con i delfini è una delle esperienze più emozionanti e divertenti che una persona possa vivere. Immergiti e impara a conoscere uno degli animali più intelligenti e giocosi presenti in natura. Seguiti dai nostri collaboratori, i visitatori (a gruppi di dieci) entreranno innanzitutto in una piscina per iniziare a interagire con i nostri delfini, in modo da comprendere rapidamente il loro comportamento. Successivamente, verrà consegnata una muta e un salvagente per iniziare questa indimenticabile immersione.<br/><br/>\r\nL\'attività è aperta a tutti gli adulti e ai bambini dagli 8 anni in su. E\' consigliato comunicare in anticipo la volontà di effettuare l\'immersione il giorno della visita, in modo da poter garantire la disponibilità. Durata dell\'attività: 45 minuti circa.', );
INSERT INTO `attivita` (`ID_Att`, `Nome_Att`, `Descrizione_Att`, `Immagine_Att`) VALUES
(2, 'PASSEGGIATA CON I PRIMATI', 'Passeggiata in mezzo alla natura circondati dalla simpatia dei nostri primati.', );
INSERT INTO `attivita` (`ID_Att`, `Nome_Att`, `Descrizione_Att`, `Immagine_Att`) VALUES
(3, 'INCONTRO RAVVICINATO CON I LEONI', 'Chi non ha mai sognato di accarezzare uno dei felini più grandi in natura? Allo Zoo Creola tutto ciò sarà possibile! Nel corso della visita allo zoo, in orari predefiniti (presenti nel volantino che verrà consegnato all\'ingresso), i nostri visitatori più coraggiosi, insieme al nostro staff, potranno interagire e dare da mangiare ai nostri leoni! <br/><br/>L\'attività è aperta a tutti gli adulti e ai bambini dai 10 anni in su accompagnati da un adulto.', );
INSERT INTO `attivita` (`ID_Att`, `Nome_Att`, `Descrizione_Att`, `Immagine_Att`) VALUES
(4, 'ATTIVITA\' DIDATTICHE PER LE SCUOLE', 'Per tutte le scuole, saranno disponibili, alla fine della visita al parco, una serie di laboratori didattici e attività per imparare tutte le curiosità della natura e in particolare del mondo animale. I bambini potranno interagire con alcuni piccoli animali, toccare e studiare vari reperti tra cui fossili, ossa di animali e altri reperti per conoscere le degli animali dello zoo e di altri estinti da milioni di anni. <br/><br/>L\'attività è dedicata a tutte le scuole e con un numero massimo di 25 bambini per turno. La prenotazione delle attività è obbligatoria e va comunicata al momento della prenotazione della visita allo zoo. Per le prenotazioni online, invece, è richiesta la compilazione di un form. Durata dell\'attività: 1 ora circa\r\n', );

